import '../index.css'
import React from 'react';
import { Link } from 'react-router-dom';

export const Navbar = () =>{

    return(
        <div className='navbar'>
            <button>
                <Link to='/'></Link>
            </button>
            <button>Contact</button>
            <button>More</button>
        </div>
    )
}
